import React, {Component} from "react";
import './App.css';
import Navbar from "./components/Navbar/Navbar";
import SecondPost from "./components/SecondPost/SecondPost";
import {BrowserRouter, Routes, Route, Link} from "react-router-dom";
import {updateNewPostText} from "./redux/store";
import ProfileContainer from "./components/Profile/ProfileContainer";
import CarContainer from "./components/Car/CarContainer";
import UsersContainer from "./components/Users/UsersContainer";
import ProfileBossContainer from "./components/Profile/ProfileBossContainer";
import HeaderContainer from "./components/Header/HeaderContainer";
import Login from "./components/Login/Login";
import DialogsContainer from "./components/Dialogs/DialogsContainer";
import {connect} from "react-redux";
import {withRouter} from "react-router";
import {compose} from "redux";
import {initializeApp} from "./redux/app-reducer";
import Infinity from "./components/Common/Infinity/Infinity";

class App extends Component {
    componentDidMount() {
        this.props.initializeApp();
    }

    render() {

        if(!this.props.initialized) {
            return <Infinity/>
        }
        return (
            <div className="app-wrapper">
                <HeaderContainer/>
                <Navbar/>
                <div className='app-wrapper-content'>
                    <Route path="/profile/:userId?"
                           render={() => <ProfileBossContainer/>}/>
                    <Route path="/Car/"
                           render={() => <CarContainer/>}/>
                    {/*<Route path="/users/"
                           render={() => <UsersContainer/>}/>*/}
                    <Route path="/login/"
                           render={() => <Login/>}/>
                    <Route path="/dialogs/"
                           render={() => <DialogsContainer/>}/>
                </div>
            </div>
            /*<div className="app-wrapper"> // для реакт роутер дом выше 6.0
                <Header/>
                <Navbar/>
                <div className='app-wrapper-content'>
                    <Routes>
                        <Route  path="/profile/:userId"
                                element={<ProfileBossContainer/>}/>
                        <Route  path="/Car/"
                                element = {<CarContainer/>} />
                        <Route  path="/users/"
                                element = {<UsersContainer/>} />
                    </Routes>
                </div>
            </div>*/
        );
    }
}
const mapStateToProps = (state) => ({
    initialized: state.app.initialized
})

export default compose (
    withRouter,
    connect(mapStateToProps,  {initializeApp})) (App);
